  and salinity profiles from surface sensors and CTD casts in the Gulf of Alaska from
  the SURVEYOR as part of the Outer Continental Shelf Environmental Assessment Program
  (OCSEAP) from 21 September 1975 to 22 September 1975 (NODC Accession 7601224)\",\n\t\"tracking_summary\":
