  [],\n\t\"revision_timestamp\": \"2016-06-07T02:04:31.824720\",\n\t\"name\": \"temperature-and-salinity-profiles-from-surface-sensors-and-ctd-casts-in-the-gulf-of-alaska-from\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Temperature and salinity profiles were
  collected from surface sensors and CTD casts in the Gulf of Alaska from the SURVEYOR.
  Data were collected by the Pacific Marine Environmental Laboratory (PMEL) as part
  of Outer Continental Shelf Environmental Assessment Program (OCSEAP) from 21 September
  1975 to 22 September 1975. Data were processed by NODC to the NODC standard F022
  High-Resolution CTD/STD Output Format. Full format description is available from
  NODC at www.nodc.noaa.gov/General/NODC-Archive/f022.html. An analog file for this
  accession is available from NODC user services.nnThe F022 format contains high-resolution
  data collected using CTD (conductivity-temperature-depth) and STD (salinity-temperature-depth)
  instruments. As they are lowered and raised in the oceans, these electronic devices
  provide nearly continuous profiles of temperature, salinity, and other parameters.
  Data values may be subject to averaging or filtering or obtained by interpolation
  and may be reported at depth intervals as fine as 1m. Cruise and instrument information,
  position, date, time and sampling interval are reported for each station. Environmental
  data at the time of the cast (meteorological and sea surface conditions) may also
  be reported. The data record comprises values of temperature, salinity or conductivity,
  density (computed sigma-t), and possibly dissolved oxygen or transmissivity at specified
  depth or pressure levels. Data may be reported at either equally or unequally spaced
  depth or pressure intervals. A text record is available for comments.\",\n\t\"license_title\":
